import { useContext } from "react"
import React   from 'react'
import { StateContext} from '../../context/AppProvider'
import {DispatchContext} from '../../context/AppProvider'

const AddtoCart = ({cartitems , deletCartItem})=>{

    const Cartpakages = useContext(StateContext)
    const dispatch = useContext(DispatchContext)

    let cartpakageAre = Cartpakages.cartItems.map((item , index)=>{
        return(
            <div  key={item.index}>
                <h5>{item.title}</h5>
                <img src={item.img} alt="" />
                <button className="add-t-cart-item-delete-h1" onClick={

                    ()=>{
                    dispatch({
                        action : "delete cart item",
                        payload: {
                            id: item.id,
                        }
                    })
                }
                }>Delete</button>
                <h2>Rs:- 299/-</h2>
            </div>
        )
    })


    return(
        <div className="add-to-cart-wrappr">
            <div className="container">
            <div className="add-t-cart-item">
             <h4>Your Cart</h4>
              {cartpakageAre}
            </div>
            </div>
        </div>

    )
}


export default AddtoCart
